import "../styles/Navbar.scss";
import { RiNetflixFill } from "react-icons/ri";
const Navbar = () => {
  return (
    <div>
      <div className='Navbar'>
        <div className='icon'>
          <RiNetflixFill style={{ fontSize: "30px", paddingLeft: "0px" }} />
        </div>
        <div className='toggles'>
          <ul>
            <li>Home</li>
            <li>Trends</li>
            <li>Top</li>
            <li>Upcoming</li>
            <li>Latest</li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
